description:
Totaal serves the noodles in the famous yellow noodle shop under the bridge by the expressway. She worked her way up from the kitchen to serving in the forecourt, and hopes that she will one day be manager. No chance, her boss is already fed up with her flirting and acting silly with the customers. All they want to do is suck up their noodles. All I want to do suck on her sweet penis. Watch the video. 

